profile_summary:
Former Navy Officer and Senior Executive with a demonstrated history of leadership.  Skilled in Operational Planning, Budgeting, Safety and Environmental Compliance, Training, Facilities Management, Facilities Security, Leadership, and Project Management. Strong Senior level Executive and operational planner with a Bachelor's degree in Mathematics from Marquette University and Master's degree focused in Engineering/Industrial Management from Old Dominion University.
